import React from 'react'

const Input = ({ name, type, value, placeholder, id }) => {
  return (
    <div className='relative w-[100%] mb-4'>
      <input 
        id={id}
        name={name}
        type={type}
        placeholder={placeholder}
        defaultValue={value}
        className='input-box'
      />
      <i className={``}></i>
    </div>
  )
}

export default Input
